import React from "react";
import { Link } from "react-router-dom";
import "../App.css";

const Main = (props) => {
  return (
    <>
      <div>
        <img src="images/map.jpg"></img>
      </div>
      <button className="btn">
        <img src="images/button.png"></img>
      </button>
    </>
  );
};

export default Main;
